export const ListContact = ({ filter, onDeleteContact }) => {
  return (
    <div>
      <ul>
        {filter.map(item => (
          <li key={item.id}>
            <p>
              {item.name}:{item.number}
            </p>
          </li>
        ))}
      </ul>
    </div>
  );
};
